import React, { Component } from 'react';

class Member extends Component {
    state = {
        information: [
            {
                number: 'DSM2016',
                name: '이재석'
            }
        ]
    }
    render() {
        const { number, name } = this.state.information;
        return (
            <p>{number} {name}</p>
        );
    }
}

export default Member;
